graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Documented System</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "Start" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>Start</b></td></tr></table>>, shape=ellipse, fillcolor="#FFF3E0", style=filled, color="#F57C00"];
  "End" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>End</b></td></tr></table>>, shape=box, fillcolor="#FFFFFF", style=filled, color="#000000"];

  // Root-level notes
  "note_Processor_0" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"></table>>, shape=note, fillcolor="#FFFACD", style=filled, fontsize=9];
  "note_Processor_0" -> "Processor" [style=dashed, color="#999999", arrowhead=none];

  // Edges
  "Start" -> "Input" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Input" -> "Validate" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Validate" -> "Transform" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Transform" -> "Output" [labelOverlay="75%", labelhref="#srcLineTBD"];
  "Output" -> "End" [labelOverlay="75%", labelhref="#srcLineTBD"];
}
